  def download_pages(year, total_pages, cookie, page_number, retries= 0)
    url = "https://jeffersontxclerk.manatron.com/Court/SearchResults.aspx?pg=#{page_number}"
    puts page_number
    return if page_number.to_i >= total_pages.to_i
    new_headers = {}
    new_headers["Cookie"] = cookie
    data_page = scraper.connect_to(url:url, headers:new_headers)
    download(year) if retries == 5
    download_pages(year, total_pages, cookie, page_number, retries+1) if data_page.status != 200
    save_page(data_page, "page_#{page_number}", year.to_s)
    download_pages(year, total_pages, cookie, page_number+1, 0)
  end


  def cookie_authorization(cookie, page)
    headers_value = {}
    headers_value["Cookie"] = cookie,
    main_page_url = "https://jeffersontxclerk.manatron.com/"
    page = scraper.authenticate_cookies(cookie)
    url = "https://jeffersontxclerk.manatron.com/Court/SearchEntry.aspx?cabinet=COURT_CIVIL"
    refer_url = "https://jeffersontxclerk.manatron.com/?InvalidSearch"
    page = scraper.main_request(cookie, url, refer_url)
    return cookie if page.status==200
  end

  def store
    run_id = keeper.run_id
    peon.list(subfolder:run_id.to_s).each do |year|
      sub_folder = keeper.run_id.to_s+"/"+year.to_s
      pages = peon.give_list(subfolder:sub_folder).sort
      pages.each do|page|
        case_info, case_party, case_activities = parser.parsing(peon.give(subfolder:sub_folder, file:page), run_id)
        keeper.insert_records(case_info) unless case_info.empty?
        keeper.insert_activity(case_activities) unless case_activities.empty?
        keeper.insert_party(case_party) unless case_party.empty?
      end
    end
    keeper.update_touch_run_id
    keeper.finish
  end

